当一个命题要素标示一个复合物时，可以从它在其中出现的命题的不确定性看出来。我们<emphasis>知道</emphasis>，这种情形下这个命题有些东西是没有规定的。（概括性记号总是<emphasis>包含</emphasis>一种原型。）
